function verifyWebhookSignature(payload, signatureHeader, apiSecret) {
  /**
   * Verify webhook signature
   * 
   * @param {Object} payload - Parsed JSON payload object
   * @param {string} signatureHeader - Value from X-Webhook-Signature header
   * @param {string} apiSecret - Your API secret
   * @returns {boolean} True if signature is valid, False otherwise
   */
  // Extract fields from payload
  const userReferenceId = payload.user_reference_id || '';
  const txnid = payload.data?.txnid || '';
  const status = payload.data?.status || '';
  
  // Build signature string: user_reference_id|txnid|status
  const signatureString = userReferenceId + '|' + txnid + '|' + status;
  
  // Compute HMAC-SHA256
  const computedSignature = crypto
    .createHmac('sha256', apiSecret)
    .update(signatureString)
    .digest('hex');
  
  // Compare signatures (use constant-time comparison to prevent timing attacks)
  return crypto.timingSafeEqual(
    Buffer.from(computedSignature),
    Buffer.from(signatureHeader)
  );
}

